            selector: 'page-about',template:/*ion-inline-start:"E:\RN-Valves-APP-priya-new\src\pages\about\about.html"*/'  <ion-header class="main-header remove " >\n    <ion-navbar >\n      <ion-title>\n          Company Profile\n      </ion-title>\n    </ion-navbar>\n  </ion-header>\n  \n  <ion-content>\n  <div class="about-info">\n    <div class="content">\n        <img src="assets/imgs/baseline-format.svg">\n        <p>WELCOME TO RN Valves</p>\n        <!-- <p>Quality is not what happens when what you do matches your intentions. It is what happens when what you do matches your customer\'s expectations</p> -->\n    </div>\n  \n    <div class="perha">\n      <ul>\n        <li>\n          <p>People like enhancing their experience in every little way, be it in the bathroom and anywhere else. We, at RN Valves, understand these small but precious needs of our customers are fully committed to delivering nothing but unmatched bathroom products. Whether you look at our products aesthetically, experientially, or technically, the premium segment of RN Valves is what comes to your mind, first up!\n          </p>\n        </li>\n        <li>\n          <p>Pick any of our faucets or valves, the thing that strikes you the most is their function and form. Our designs are exquisite too! At RN Valves, we understand that our products need to meet the global standards of safety, ergonomics, material, finish, and functionality. That’s why we have designed and developed products that are truly world-class.\n          </p>\n        </li>\n        <li>\n          <p>We are proud to have a dedicated and strong Research and Development team that is among the best you can find anywhere. Our equipment and cutting-edge processes that are employed to carefully design and produce faucets and valves are sure to provide you value for money proposition. This is guaranteed. Our constant innovation coupled with sharp brains ensures the quality checks that each of the products goes through before reaching you are of international standards. Whether you look at our products from an aesthetic point of view or functionally, you’re sure to get what you were looking for and even more!\n          </p>\n        </li>\n        <li>\n          <p>RN Valves started its business operation in 2000 and has never looked back since then. From the humble beginning, we have had in 2000; we have grown considerably to include more than 1000 dealers and distributors that are spread across India. We are proud of this fact and promise you to continue this growth journey in the future as well. Today, our manufacturing plant located in New Delhi is the workplace for more than 150 employees. Our unit that is spread across 3 acres is at the center of all action! We continue to script our story from this place and look forward to serving you with great products and excellent service.\n          </p>\n        </li>\n        <li>\n          <p>Cheers!!</p>\n        </li>\n  \n      </ul>\n    </div>\n  </div>\n  </ion-content>\n  '/*ion-inline-end:"E:\RN-Valves-APP-priya-new\src\pages\about\about.html"*/
